import { createSlice } from "@reduxjs/toolkit";

const cardslice = createSlice({
  name: "cards",
  initialState: {
    tokenStore: -1,
    
  },
  reducers: {
    OnClickImage(state,action){
      state.Id=action.payload
    }
  },
});

export const { OnClickImage } =
  cardslice.actions;
export default cardslice.reducer;
